import React from "react";

const Hero = () => {
  return (
    <section className="min-h-screen flex flex-col justify-center items-center bg-gray-900 text-white">
      <h1 className="text-6xl font-bold">Your Name</h1>
      <p className="mt-4 text-xl">Your Career Objective or Tagline</p>
      <p className="mt-2 text-lg">A brief description about yourself.</p>
    </section>
  );
};

export default Hero;
